import React from 'react'
import FacebookPost from './FacebookPost'
import '../style/App.css'

function App() {
  // Let's
  return (
    <div className='home'>
      <h1>FaceBruh</h1>
      <h2>Posts:</h2>
      <div className='posts'>
        <FacebookPost author='Enrypase' imgLink='data:image/jpeg;base64,' description='Ayo'/>
        <FacebookPost author='General Kenobi' imgLink='https://nerdbot.com/wp-content/uploads/2020/01/1r3fn3-e1579990017466.jpg?ezimgfmt=ng%3Awebp%2Fngcb1%2Frs%3Adevice%2Frscb1-2' description='Hello There!'/>
        <FacebookPost author='General Grievous' imgLink='data:image/jpeg;base64,' description='General Kenobi'/>
      </div>    
    </div>
  )
}

export default App;
